import React, { useState } from "react";

const Dashboard = ({ userName = "Kumaran" }) => {
  const [selectedDoctor, setSelectedDoctor] = useState("");
  const [appointmentDate, setAppointmentDate] = useState("");
  const [appointmentTime, setAppointmentTime] = useState("");
  const [appointments, setAppointments] = useState([]);

  const doctors = [
    "Dr. John - Cardiologist",
    "Dr. Smith - Dermatologist",
    "Dr. Sam - Neurologist",
    "Dr. Johnson - Orthopedic",
  ];

  const handleChange = (e) => {
    setSelectedDoctor(e.target.value);
  };

  const handleBookAppointment = () => {
    if (selectedDoctor && appointmentDate && appointmentTime) {
      const newAppointment = {
        doctor: selectedDoctor,
        date: appointmentDate,
        time: appointmentTime,
      };

      setAppointments([...appointments, newAppointment]);
      setSelectedDoctor("");
      setAppointmentDate("");
      setAppointmentTime("");
    }
  };

  return (
    <div className="dashboard">
      <section className="dashboardsection">
        <div className="container mt-4">
          <h2 className="text-start">Dashboard</h2>
          <h3 className="text-start mt-3">Welcome, {userName}!</h3>

          {/* Book an Appointment */}
          <div className="mt-4">
            <h4>Book an Appointment</h4>
            <hr className="border border-3 border-success" />

            <div className="row g-3 mt-2">
              {/* Doctor Selection */}
              <div className="col-md-4">
                <div className="form-floating">
                  <select
                    className="form-control"
                    id="floatingDoctor"
                    value={selectedDoctor}
                    onChange={handleChange}
                  >
                    <option value="">Select a Doctor</option>
                    {doctors.map((doctor, index) => (
                      <option key={index} value={doctor}>
                        {doctor}
                      </option>
                    ))}
                  </select>
                  <label htmlFor="floatingDoctor">Choose a Doctor</label>
                </div>
              </div>

              {/* Date Selection */}
              <div className="col-md-4">
                <div className="form-floating">
                  <input
                    type="date"
                    className="form-control"
                    id="floatingDate"
                    value={appointmentDate}
                    onChange={(e) => setAppointmentDate(e.target.value)}
                  />
                  <label htmlFor="floatingDate">Select Date</label>
                </div>
              </div>

              {/* Time Selection */}
              <div className="col-md-4">
                <div className="form-floating">
                  <input
                    type="time"
                    className="form-control"
                    id="floatingTime"
                    value={appointmentTime}
                    onChange={(e) => setAppointmentTime(e.target.value)}
                  />
                  <label htmlFor="floatingTime">Select Time</label>
                </div>
              </div>

              {/* Book Button */}
              <div className="col-md-12 d-flex justify-content-end">
                <button
                  className="btn btn-success"
                  onClick={handleBookAppointment}
                  disabled={!selectedDoctor || !appointmentDate || !appointmentTime}
                >
                  Book Appointment
                </button>
              </div>
            </div>
          </div>

          {/* My Appointments Section */}
          <div className="mt-5">
            <h4>My Appointments</h4>
            <hr className="border border-3 border-primary" />
            {appointments.length === 0 ? (
              <p className="text-muted">No active appointments.</p>
            ) : (
              <ul className="list-group">
                {appointments.map((appointment, index) => (
                  <li key={index} className="list-group-item d-flex justify-content-between">
                    <span>
                      ðŸ“… {appointment.date} - ðŸ•’ {appointment.time} - {appointment.doctor}
                    </span>
                    <button className="btn btn-danger btn-sm">Cancel</button>
                  </li>
                ))}
              </ul>
            )}
          </div>
        </div>
      </section>
    </div>
  );
};

export default Dashboard;
